import React from "react";
import styled from "styled-components";
import Button from "./Button";

const Container = styled.div `
    display: flex;
    flex-direction: column;
    align-items: start;
    border: 2px solid #000000;
    border-radius: 10px;
    padding: 14px;
`
const TextContainer = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
`


const Information = () => {
    return (
        <Container>
            <TextContainer>
                <p>ПОЛОЖЕНИЕ БЛОКОВ:</p><span>СЕТКА</span>
            </TextContainer>
            <TextContainer>
                <p>ЗНАЧЕНИЕ СЧЕТЧИКА:</p><span>210</span>
            </TextContainer>
            <TextContainer>
                <p>БЛОКИРОВКА СЧЕТЧИКА:</p><span>ДА</span>
            </TextContainer>
            <Button>ВЫВЕСТИ ИНФУ В БЛОК 4</Button>
        </Container>
    )
}

export default Information;
